import React from "react";
import InputFiled from "../../inputFiled/inputFiled";
import { SecondaryButton } from "../../Styled_Components/Buttons";
import "../SingInPage/SingInPage.css";
const SingUpPage = () => {
  const [email, setEmail] = useState<string>("");
  const [password, setPassword] = useState<string>("");
  const handleSetEmail = (value: string) => setEmail(value);
  const handlesSetPassword = (value: string) => setPassword(value);
  return (
    <div className="main">
      <div className="singINCard">
        <div className="info">
          <span>SING UP</span>
        </div>
        <div className="inputField">
          <InputFiled label={"Email address"} onChange={handleSetEmail} />
          <InputFiled
            type="password"
            label={"Password"}
            onChange={handlesSetPassword}
          />
        </div>
        <SecondaryButton isActive={true} className="singUpButtons">
          sign up
        </SecondaryButton>
      </div>
    </div>
  );
};
export default SingUpPage;
